"use strict";(self.webpackChunkmycelium=self.webpackChunkmycelium||[]).push([[4615],{8163:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"bienvenue","metadata":{"permalink":"/mycelium/blog/bienvenue","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/index.md","source":"@site/blog/index.md","title":"Bienvenue","description":"Bienvenue sur ce blog d\xe9di\xe9 aux passionn\xe9s du d\xe9veloppement web !","date":"2024-07-19T13:42:02.000Z","tags":[],"readingTime":0.495,"hasTruncateMarker":false,"authors":[{"name":"Christian HUMBERT","title":"Cr\xe9ateur de Myc\xe9lium","url":"https://www.linkedin.com/in/christian-humbert-developpeur-web/","imageURL":"https://media.licdn.com/dms/image/D4E03AQG37et6KTEyfA/profile-displayphoto-shrink_400_400/0/1718639795147?e=1726704000&v=beta&t=IiERR7k-IzLWPUIEp7ZJ3jp0Y8-Tx4EtGdIiBT4QupI","key":"chumbert"}],"frontMatter":{"slug":"bienvenue","title":"Bienvenue","authors":["chumbert"]},"unlisted":false,"nextItem":{"title":"Entrevue avec Fran\xe7ois DUVAL","permalink":"/mycelium/blog/inteview-de-Francois-DUVAL"}},"content":"Bienvenue sur ce blog d\xe9di\xe9 aux passionn\xe9s du d\xe9veloppement web !\\n\\nIci, tu trouveras une collection enrichissante d\'interviews de d\xe9veloppeurs web, allant des d\xe9butants aux experts confirm\xe9s. R\xe9guli\xe8rement, seront post\xe9es des discussions inspirantes avec des professionnels du domaine, qui partagent leurs exp\xe9riences, leurs d\xe9fis et leurs r\xe9ussites.\\n\\nQue tu sois un novice cherchant des conseils pour d\xe9buter ou un d\xe9veloppeur aguerri en qu\xeate de nouvelles perspectives, ce blog est l\'endroit id\xe9al pour d\xe9couvrir des parcours vari\xe9s, des astuces pratiques et des insights sur les tendances actuelles du d\xe9veloppement web.\\n\\nTu veux donner ton t\xe9moignage ? Contacte-moi sur LinkedIn !"},{"id":"inteview-de-Francois-DUVAL","metadata":{"permalink":"/mycelium/blog/inteview-de-Francois-DUVAL","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-07-19-Fran\xe7ois_DUVAL.md","source":"@site/blog/2024-07-19-Fran\xe7ois_DUVAL.md","title":"Entrevue avec Fran\xe7ois DUVAL","description":"Un developpeur passionn\xe9, une curiosit\xe9 insatiable, Fran\xe7ois DUVAL se pr\xeate au jeu et r\xe9pond \xe0 quelques question sur son job en g\xe9n\xe9ral !","date":"2024-07-19T00:00:00.000Z","tags":[],"readingTime":4.135,"hasTruncateMarker":true,"authors":[{"name":"Christian HUMBERT","title":"Cr\xe9ateur de Myc\xe9lium","url":"https://www.linkedin.com/in/christian-humbert-developpeur-web/","imageURL":"https://media.licdn.com/dms/image/D4E03AQG37et6KTEyfA/profile-displayphoto-shrink_400_400/0/1718639795147?e=1726704000&v=beta&t=IiERR7k-IzLWPUIEp7ZJ3jp0Y8-Tx4EtGdIiBT4QupI","key":"chumbert"},{"name":"Fran\xe7ois DUVAL","title":"D\xe9veloppeur DevOps, Formateur","url":"https://www.linkedin.com/in/francois-duval-freelance/","imageURL":"https://media.licdn.com/dms/image/C4E03AQG7VU8Rk7hKfw/profile-displayphoto-shrink_400_400/0/1527497374095?e=1726704000&v=beta&t=nSdZWTQFnhKOLh_wSW2oMJP26nmAxnmlPjLOpCLixLk","key":"fduval"}],"frontMatter":{"slug":"inteview-de-Francois-DUVAL","title":"Entrevue avec Fran\xe7ois DUVAL","authors":["chumbert","fduval"],"hide_table_of_contents":false},"unlisted":false,"prevItem":{"title":"Bienvenue","permalink":"/mycelium/blog/bienvenue"}},"content":"Un developpeur passionn\xe9, une curiosit\xe9 insatiable, Fran\xe7ois DUVAL se pr\xeate au jeu et r\xe9pond \xe0 quelques question sur son job en g\xe9n\xe9ral !\\n\\n\x3c!-- truncate --\x3e\\n\\n## Quelles \xe9tudes scolaires as-tu faites ?\\n\\nEn terme d\'\xe9tudes scolaire, j\'ai fait un _Bac S_ (Scientifique) sp\xe9cialit\xe9 Math et option SI (Sciences de l\'ing\xe9nieur) puis _\xc9cole d\'Ing\xe9 G\xe9n\xe9raliste_.\\n\\n## Qu\'est-ce qui t\'a donn\xe9 envie de devenir dev ?\\n\\nJ\'ai commenc\xe9 le code en premi\xe8re ann\xe9e de coll\xe8ge... et j\'ai toujours cod\xe9 des choses pendant ou apr\xe8s les cours \ud83d\ude04\\nDonc, le choix de ma voie \xe9tait assez logique, m\xeame si aujourd\'hui je vois comme un outil. Au d\xe9but, c\'\xe9tait tr\xe8s facile pour moi et que je pouvais tout faire dans ce monde du num\xe9rique qui commen\xe7ait \xe0 prendre de l\'ampleur.\\n\\n#### Quel \xe9tait le langage que tu utilisais \xe0 l\'\xe9poque ?\\n\\nDu basic \ud83d\ude04 Pour \xeatre pr\xe9cis du QBasic. C\'est l\'anc\xeatre de ce qu\'on trouve sur les calculatrices scientifiques. Il fallait noter les num\xe9ros de ligne avant chaque commande manuellement ! Et si on voulait ins\xe9rer du code, il fallait changer tous les num\xe9ros de lignes \ud83d\ude36\ud83d\ude31\\n\\n## Quelle formation as-tu suivie pour devenir dev ?\\n\\nApr\xe8s l\'\xe9cole... beaucoup \ud83d\ude01. J\'ai suivi beaucoup de cours, de tutos, ... Dur dur de tout suivre, et j\'en fais encore plusieurs par an.\\n\\nJ\'ai fait quelques certifications dont _AWS_, la developper associate.\\n\\nJ\'avais fait la _DevOps_, mais je n\'ai pas pass\xe9 la certif, par contrela formation est g\xe9niale pour s\'y pr\xe9parer \ud83d\ude42\\n\\nLes autres ont rarement des certifications officielles. Et au d\xe9but, durant mes 8 premi\xe8res ann\xe9es j\'\xe9tais full-autodidacte \ud83d\ude09\\n\\n## On entend beaucoup parler de DevOps... Qu\'est-ce que c\'est ? Un langage de programmation ?\\n\\nCela veut dire *Developpeur Op\xe9rationnel*\ud83d\ude42. Le dev \xe9crit du code, l\'op\xe9rateur s\'assure que le code tourne en prod. Donc, le DevOps c\'est celui qui s\'assure que le code va \xeatre test\xe9, v\xe9rifi\xe9, valid\xe9, et d\xe9ploy\xe9 \ud83d\ude42\\n\\nOn parle \'niveaux\' ou \'piliers du devops\', le **CALMS** => **C**ulture, **A**utomation, **L**ean, **M**easurement, **S**haring\\n\\nPour \xeatre plus pr\xe9cis :\\n\\n- Le d\xe9veloppeur transforme les exigences (sp\xe9cifications) du client en code.\\n\\n- Le DevOps fournit les outils n\xe9cessaires aux d\xe9veloppeurs et optimise le pipeline (le flux correspond au contenu, et le pipeline au contenant.\\n  Imaginons un long tuyau dans lequel une balle avance), le tuyau \xe9tant un des pipeline (d\'o\xf9 son nom) et la balle le code (ou le workflow = flux de travail), le DevOps \xe0 la responsabilit\xe9 de tout ces tuyau.\\n\\n- Une fois l\'application d\xe9ploy\xe9e (en fin de tuyau), elle devient la responsabilit\xe9 de l\'op\xe9rateur qui va s\'assurer que la production tourne et cat\xe9goriser les erreurs afin de les remonter \xe0 l\'\xe9quipe de dev.\\n\\n#### Quelle diff\xe9rence entre DevOps et Administrateur r\xe9saux ? Parce que peut faire penser \xe0 \xe7a...\\n\\nL\'administrateur r\xe9seau g\xe8re principalement le r\xe9seau, la charge serveur, et compagnie \ud83d\ude04\\n\\nAlors que le DevOps va s\'assurer que des tests unitaires soient lanc\xe9s, optimiser les images, donner des linter et configuration aux \xe9quipes, lancer des machines pour tester en feature branch...\\n\\nDonc le r\xe9seau va s\'assurer que les moyens sont suffisant pour l\'entreprise et les clients. Le DevOps va s\'occuper des outils pour s\'assurer que le code est bon.\\n\\n## Qu\'est-ce qui te plait dans ce m\xe9tier ?\\n\\nLa diversit\xe9 gigantesque de tout ce qu\'on peut faire. J\'ai travaill\xe9 avec tellement de secteurs, ma curiosit\xe9 n\'est jamais rassasi\xe9e !\\n\\n## Quelles technos que aimes-tu utiliser, et pourquoi ?\\n\\nJ\'en ai test\xe9 tellement, mais je trouve _Typescript_ le plus stable dans le temps alliant les forces de toutes \xe0 la fois \ud83d\ude42 (ou presque). Puis actuellement, _NextJS_ et peut-\xeatre _N8N_ et _Supabase_. M\xeame si les technos \xe9voluent tellement vite\\n\\n## \xc0 quoi ressemble ta journ\xe9e de dev ?\\n\\nEn g\xe9n\xe9ral un point quotidien, sp\xe9cification et code.\\n\\nLe midi j\'essaie de faire un peu de sport ou d\'\xe9crire des articles. Je me prends 2x30min par jour pour r\xe9pondre aux questions sur **LinkedIn** ou **Discord**.\\n\\nEt le soir, je code sur mes projets persos et en ce moment des SaaS ou des formations.\\n\\nLes t\xe2ches sont tr\xe8s larges, \xe7a peut \xeatre autant le fait d\'ajouter une fonctionnalit\xe9, int\xe9grer un site, mettre en place un script CI ou m\xeame faire de la veille pour trouver le meilleur outil \xe0 utiliser pour la suite, pour r\xe9pondre au besoin.\\n\\n# D\xe9finition des termes utilis\xe9s\\n\\n:::info[SasS]\\n_Software as a Service_.\\n\\nIl s\'agit d\'une application sur le cloud qui fournit divers outils et services pour les d\xe9veloppeurs.\\n\\n:::\\n\\n:::info[Script CI]\\n_Continuous Integration_.\\n\\nC\'est un ensemble de commandes et de configurations qui automatisent le processus de construction, de test et de d\xe9ploiement d\'une application \xe0 chaque modification du code. Cela permet d\'assurer que le code est toujours dans un \xe9tat d\xe9ployable et de d\xe9tecter rapidement les erreurs.\\n\\n:::\\n\\n:::info[AWS]\\n_Amazon Web Services_.\\n\\nAWS est une plateforme de services de cloud computing propos\xe9e par Amazon, qui offre une vaste gamme de services qui peuvent \xeatre utilis\xe9s pour le d\xe9veloppement, le d\xe9ploiement et la gestion des applications.\\n\\n:::"}]}}')}}]);